description:
La prestation de la présente consultation consiste principalement en : 
-	L’évaluation du niveau de qualité des prestations délivrées par les structures médico-Sociales de l’EHPAD FELIX LOBLIGEOIS aux personnes accompagnées 
-	Il est rappelé que l’évaluation :
 	doit être réalisée par des organismes extérieurs aux ESMS, indépendants et figurant sur la liste, publiée par la Haute Autorité de Santé (HAS), des organismes autorisés à évaluer les établissements et services visés à l'article L.312-1 du code de l'action sociale et des familles. 
 	Il est précisé que les candidatures et offres des organismes dont les dossiers d’accréditation sont en cours sont recevables ;
 	doit avoir lieu à partir doit avoir lieu à partir du référentiel de la HAS qui s'appuie sur le manuel définissant des méthodes d'évaluation des pratiques et des organisations ;
